('node', 'page', 0, 17, 17, 'und', 0, ' <div class="panel">\r\n<div class="panel-heading">Bienvenue sur le site de L''AEFAT</div>\r\n<div class="panel-body">\r\n<span>L''Association des étudiants Burkinabè de Toulouse </span>\r\nLe Lorem Ipsum est simplement du faux texte employé dans la composition et la mise en page avant impression. Le Lorem Ipsum est le faux texte standard de l''imprimerie depuis les années 1500, quand un peintre anonyme assembla ensemble des morceaux de texte pour réaliser un livre spécimen de polices de texte. Il n''a pas fait que survivre cinq siècles, mais s''est aussi adapté à la bureautique informatique, sans que son contenu n''en soit modifié. Il a été popularisé dans les années 1960 grâce à la vente de feuilles Letraset contenant des passages du Lorem Ipsum, et, plus récemment, par son inclusion dans des applications de mise en page de texte, comme Aldus PageMaker.\r\n  On sait depuis longtemps que travailler avec du texte lisible et contenant du sens est source de distractions, et empêche de se concentrer sur la mise en page elle-même. L''avantage du Lorem Ipsum sur un texte générique comme ''Du texte. Du texte. Du texte.'' est qu''il possède une distribution de lettres plus ou moins normale, et en tout cas comparable avec celle du français standard. De nombreuses suites logicielles de mise en page ou éditeurs de sites Web ont fait du Lorem Ipsum leur faux texte par défaut, et une recherche pour ''Lorem Ipsum'' vous conduira vers de nombreux sites qui n''en sont encore qu''à leur phase de construction. Plusieurs versions sont apparues avec le temps, parfois par accident, souvent intentionnellement (histoire d''y rajouter de petits clins d''oeil, voire des phrases embarassantes).\r\n</div>\r\n</div>', '', 'full_html'),
('node', 'page', 0, 18, 18, 'und', 0, 'Actualité goes here', '', 'filtered_html'),
('node', 'page', 0, 21, 21, 'und', 0, '<div class="panel panel-default">\r\n  <div class="panel-heading">\r\n    <h3 class="panel-title">A propos de l''AEFAT</h3>\r\n  </div>\r\n  <div class="panel-body">\r\n    Contrairement à une opinion répandue, le Lorem Ipsum n''est pas simplement du texte aléatoire. Il trouve ses racines dans une oeuvre de la littérature latine classique datant de 45 av. J.-C., le rendant vieux de 2000 ans. Un professeur du Hampden-Sydney College, en Virginie, s''est intéressé à un des mots latins les plus obscurs, consectetur, extrait d''un passage du Lorem Ipsum, et en étudiant tous les usages de ce mot dans la littérature classique, découvrit la source incontestable du Lorem Ipsum. Il provient en fait des sections 1.10.32 et 1.10.33 du "De Finibus Bonorum et Malorum" (Des Suprêmes Biens et des Suprêmes Maux) de Cicéron. Cet ouvrage, très populaire pendant la Renaissance, est un traité sur la théorie de l''éthique. Les premières lignes du Lorem Ipsum, "Lorem ipsum dolor sit amet...", proviennent de la section 1.10.32.\r\n\r\nL''extrait standard de Lorem Ipsum utilisé depuis le XVIè siècle est reproduit ci-dessous pour les curieux. Les sections 1.10.32 et 1.10.33 du "De Finibus Bonorum et Malorum" de Cicéron sont aussi reproduites dans leur version originale, accompagnée de la traduction anglaise de H. Rackham (1914).\r\n  </div>\r\n</div>\r\n\r\n<div class="panel">\r\n                          <div class="panel-body">\r\n                                  <div class="text-center mbot30">\r\n                                      <h3 class="timeline-title">L''historique de l''AEFAT</h3>\r\n                                      <p class="t-info">De sa création à ce jour</p>\r\n                                  </div>\r\n\r\n                                  <div class="timeline">\r\n                                      <article class="timeline-item">\r\n                                          <div class="timeline-desk">\r\n                   